import React from 'react'
import { Navigate } from 'react-router-dom';


const Navbar = () => {
  return (
    <nav className="w-full h-14 bg-slate-900 text-white flex items-center justify-between px-6">
      <div className="text-xl font-semibold text-indigo-400">
      </div>

      {/* Right Section */}
      <div className="flex items-center gap-4">
        <span className="text-sm text-gray-300">Pratham</span>

        <button onClick={() => Navigate} className="bg-red-500 hover:bg-red-600 px-3 py-1 rounded text-sm">
          Logout
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
